def entrance(n):

    def is_prime(num):
        if num <= 1:
            return False
        if num <= 3:
            return True
        if num % 2 == 0 or num % 3 == 0:
            return False
        i = 5
        while i * i <= num:
            if num % i == 0 or num % (i + 2) == 0:
                return False
            i += 6
        return True
    if n <= 2:
        return 'No prime numbers up to ' + str(n)
    prime_sum = 2
    for num in range(3, n + 1, 2):
        if is_prime(num):
            prime_sum += num
    return 'Sum of prime numbers up to ' + str(n) + ' : ' + str(prime_sum)

